import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useUserData } from '../context/UserDataContext';
import { 
  validateName, 
  validatePhoneNumber, 
  validateSymptoms, 
  validateLocation, 
  validateZipCode, 
  validateInsurance,
  validateAppointmentDate,
  validateAppointmentTime,
  sanitizeInput 
} from '../utils/validation';

const UserIntakeForm = () => {
  const navigate = useNavigate();
  const { state, dispatch } = useUserData();
  const [formData, setFormData] = useState({
    name: state.userData.name || '',
    phoneNumber: state.userData.phoneNumber || '',
    primarySymptoms: state.userData.primarySymptoms || '',
    address: state.userData.address || '',
    city: state.userData.city || '',
    zipCode: state.userData.zipCode || '',
    insuranceProvider: state.userData.insuranceProvider || '',
    insurancePlan: state.userData.insurancePlan || '',
    preferredDate: state.userData.preferredDate || '',
    preferredTime: state.userData.preferredTime || ''
  });
  const [errors, setErrors] = useState({});

  // Check if user is authenticated
  useEffect(() => {
    if (!state.user) {
      navigate('/login');
    }
  }, [state.user, navigate]);

  const insuranceOptions = [
    { value: '', label: 'Select your insurance provider' },
    { value: 'Aetna', label: 'Aetna' },
    { value: 'Blue Cross', label: 'Blue Cross' },
    { value: 'Cigna', label: 'Cigna' },
    { value: 'UnitedHealth', label: 'UnitedHealth' }
  ];

  const insurancePlans = {
    'Aetna': [
      { value: '', label: 'Select plan' },
      { value: 'Silver PPO', label: 'Silver PPO' },
      { value: 'Gold PPO', label: 'Gold PPO' },
      { value: 'Bronze PPO', label: 'Bronze PPO' }
    ],
    'Blue Cross': [
      { value: '', label: 'Select plan' },
      { value: 'Gold HMO', label: 'Gold HMO' },
      { value: 'Silver HMO', label: 'Silver HMO' },
      { value: 'Platinum PPO', label: 'Platinum PPO' }
    ],
    'Cigna': [
      { value: '', label: 'Select plan' },
      { value: 'Bronze PPO', label: 'Bronze PPO' },
      { value: 'Silver PPO', label: 'Silver PPO' },
      { value: 'Gold PPO', label: 'Gold PPO' }
    ],
    'UnitedHealth': [
      { value: '', label: 'Select plan' },
      { value: 'Platinum PPO', label: 'Platinum PPO' },
      { value: 'Gold PPO', label: 'Gold PPO' },
      { value: 'Silver PPO', label: 'Silver PPO' }
    ]
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    const sanitizedValue = sanitizeInput(value);
    
    setFormData(prev => ({
      ...prev,
      [name]: sanitizedValue
    }));
    
    // Clear error when user starts typing
    if (errors[name]) {
      setErrors(prev => ({
        ...prev,
        [name]: ''
      }));
    }
  };

  const validateForm = () => {
    const newErrors = {};
    
    const nameValidation = validateName(formData.name);
    if (!nameValidation.isValid) {
      newErrors.name = nameValidation.error;
    }
    
    const phoneValidation = validatePhoneNumber(formData.phoneNumber);
    if (!phoneValidation.isValid) {
      newErrors.phoneNumber = phoneValidation.error;
    }
    
    const symptomsValidation = validateSymptoms(formData.primarySymptoms);
    if (!symptomsValidation.isValid) {
      newErrors.primarySymptoms = symptomsValidation.error;
    }
    
    const addressValidation = validateLocation(formData.address);
    if (!addressValidation.isValid) {
      newErrors.address = addressValidation.error;
    }
    
    const cityValidation = validateLocation(formData.city);
    if (!cityValidation.isValid) {
      newErrors.city = cityValidation.error;
    }
    
    const zipValidation = validateZipCode(formData.zipCode);
    if (!zipValidation.isValid) {
      newErrors.zipCode = zipValidation.error;
    }
    
    const insuranceValidation = validateInsurance(formData.insuranceProvider);
    if (!insuranceValidation.isValid) {
      newErrors.insuranceProvider = insuranceValidation.error;
    }
    
    if (formData.insuranceProvider && !formData.insurancePlan) {
      newErrors.insurancePlan = 'Please select your insurance plan';
    }
    
    const dateValidation = validateAppointmentDate(formData.preferredDate);
    if (!dateValidation.isValid) {
      newErrors.preferredDate = dateValidation.error;
    }
    
    const timeValidation = validateAppointmentTime(formData.preferredTime);
    if (!timeValidation.isValid) {
      newErrors.preferredTime = timeValidation.error;
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (validateForm()) {
      dispatch({
        type: 'SET_USER_DATA',
        payload: formData
      });
      navigate('/results');
    }
  };

  return (
    <div className="container">
      <div className="card">
        <div style={{ textAlign: 'center', marginBottom: '30px' }}>
          <h1 style={{ color: '#333', marginBottom: '10px' }}>Patient Intake Form</h1>
          <p style={{ color: '#666' }}>
            {state.user?.isNewUser 
              ? "Welcome! Let's get to know you better to find the perfect healthcare provider."
              : "Please update your information to help us find the best healthcare providers for you."
            }
          </p>
        </div>
        
        <form onSubmit={handleSubmit}>
          {/* Personal Information */}
          <div style={{ marginBottom: '30px' }}>
            <h2 style={{ color: '#333', marginBottom: '20px', borderBottom: '2px solid #e1e5e9', paddingBottom: '10px' }}>
              Personal Information
            </h2>
            
            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
              <div className="form-group">
                <label htmlFor="name">Full Name *</label>
                <input
                  type="text"
                  id="name"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                  placeholder="Enter your full name"
                  className={errors.name ? 'error' : ''}
                />
                {errors.name && <div className="error" style={{ marginTop: '8px' }}>{errors.name}</div>}
              </div>

              <div className="form-group">
                <label htmlFor="phoneNumber">Phone Number *</label>
                <input
                  type="tel"
                  id="phoneNumber"
                  name="phoneNumber"
                  value={formData.phoneNumber}
                  onChange={handleInputChange}
                  placeholder="(555) 123-4567"
                  className={errors.phoneNumber ? 'error' : ''}
                />
                {errors.phoneNumber && <div className="error" style={{ marginTop: '8px' }}>{errors.phoneNumber}</div>}
              </div>
            </div>
          </div>

          {/* Health Information */}
          <div style={{ marginBottom: '30px' }}>
            <h2 style={{ color: '#333', marginBottom: '20px', borderBottom: '2px solid #e1e5e9', paddingBottom: '10px' }}>
              Health Information
            </h2>
            
            <div className="form-group">
              <label htmlFor="primarySymptoms">Primary Symptoms *</label>
              <textarea
                id="primarySymptoms"
                name="primarySymptoms"
                value={formData.primarySymptoms}
                onChange={handleInputChange}
                placeholder="Describe your symptoms in detail (e.g., skin rash, chest pain, headache, fever, etc.)"
                rows="4"
                className={errors.primarySymptoms ? 'error' : ''}
              />
              {errors.primarySymptoms && <div className="error" style={{ marginTop: '8px' }}>{errors.primarySymptoms}</div>}
            </div>
          </div>

          {/* Address Information */}
          <div style={{ marginBottom: '30px' }}>
            <h2 style={{ color: '#333', marginBottom: '20px', borderBottom: '2px solid #e1e5e9', paddingBottom: '10px' }}>
              Address Information
            </h2>
            
            <div className="form-group">
              <label htmlFor="address">Street Address *</label>
              <input
                type="text"
                id="address"
                name="address"
                value={formData.address}
                onChange={handleInputChange}
                placeholder="Enter your street address"
                className={errors.address ? 'error' : ''}
              />
              {errors.address && <div className="error" style={{ marginTop: '8px' }}>{errors.address}</div>}
            </div>

            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
              <div className="form-group">
                <label htmlFor="city">City *</label>
                <input
                  type="text"
                  id="city"
                  name="city"
                  value={formData.city}
                  onChange={handleInputChange}
                  placeholder="Enter your city"
                  className={errors.city ? 'error' : ''}
                />
                {errors.city && <div className="error" style={{ marginTop: '8px' }}>{errors.city}</div>}
              </div>

              <div className="form-group">
                <label htmlFor="zipCode">Zip Code *</label>
                <input
                  type="text"
                  id="zipCode"
                  name="zipCode"
                  value={formData.zipCode}
                  onChange={handleInputChange}
                  placeholder="12345"
                  className={errors.zipCode ? 'error' : ''}
                />
                {errors.zipCode && <div className="error" style={{ marginTop: '8px' }}>{errors.zipCode}</div>}
              </div>
            </div>
          </div>

          {/* Insurance Information */}
          <div style={{ marginBottom: '30px' }}>
            <h2 style={{ color: '#333', marginBottom: '20px', borderBottom: '2px solid #e1e5e9', paddingBottom: '10px' }}>
              Insurance Information
            </h2>
            
            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
              <div className="form-group">
                <label htmlFor="insuranceProvider">Insurance Provider *</label>
                <select
                  id="insuranceProvider"
                  name="insuranceProvider"
                  value={formData.insuranceProvider}
                  onChange={handleInputChange}
                  className={errors.insuranceProvider ? 'error' : ''}
                >
                  {insuranceOptions.map(option => (
                    <option key={option.value} value={option.value}>
                      {option.label}
                    </option>
                  ))}
                </select>
                {errors.insuranceProvider && <div className="error" style={{ marginTop: '8px' }}>{errors.insuranceProvider}</div>}
              </div>

              <div className="form-group">
                <label htmlFor="insurancePlan">Insurance Plan *</label>
                <select
                  id="insurancePlan"
                  name="insurancePlan"
                  value={formData.insurancePlan}
                  onChange={handleInputChange}
                  className={errors.insurancePlan ? 'error' : ''}
                  disabled={!formData.insuranceProvider}
                >
                  {formData.insuranceProvider 
                    ? insurancePlans[formData.insuranceProvider].map(option => (
                        <option key={option.value} value={option.value}>
                          {option.label}
                        </option>
                      ))
                    : <option value="">Select insurance provider first</option>
                  }
                </select>
                {errors.insurancePlan && <div className="error" style={{ marginTop: '8px' }}>{errors.insurancePlan}</div>}
              </div>
            </div>
          </div>

          {/* Preferred Appointment */}
          <div style={{ marginBottom: '30px' }}>
            <h2 style={{ color: '#333', marginBottom: '20px', borderBottom: '2px solid #e1e5e9', paddingBottom: '10px' }}>
              Preferred Appointment
            </h2>
            
            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
              <div className="form-group">
                <label htmlFor="preferredDate">Preferred Date *</label>
                <input
                  type="date"
                  id="preferredDate"
                  name="preferredDate"
                  value={formData.preferredDate}
                  onChange={handleInputChange}
                  className={errors.preferredDate ? 'error' : ''}
                  min={new Date().toISOString().split('T')[0]}
                />
                {errors.preferredDate && <div className="error" style={{ marginTop: '8px' }}>{errors.preferredDate}</div>}
              </div>

              <div className="form-group">
                <label htmlFor="preferredTime">Preferred Time *</label>
                <select
                  id="preferredTime"
                  name="preferredTime"
                  value={formData.preferredTime}
                  onChange={handleInputChange}
                  className={errors.preferredTime ? 'error' : ''}
                >
                  <option value="">Select time</option>
                  <option value="09:00">9:00 AM</option>
                  <option value="09:30">9:30 AM</option>
                  <option value="10:00">10:00 AM</option>
                  <option value="10:30">10:30 AM</option>
                  <option value="11:00">11:00 AM</option>
                  <option value="11:30">11:30 AM</option>
                  <option value="12:00">12:00 PM</option>
                  <option value="12:30">12:30 PM</option>
                  <option value="13:00">1:00 PM</option>
                  <option value="13:30">1:30 PM</option>
                  <option value="14:00">2:00 PM</option>
                  <option value="14:30">2:30 PM</option>
                  <option value="15:00">3:00 PM</option>
                  <option value="15:30">3:30 PM</option>
                  <option value="16:00">4:00 PM</option>
                  <option value="16:30">4:30 PM</option>
                  <option value="17:00">5:00 PM</option>
                  <option value="17:30">5:30 PM</option>
                </select>
                {errors.preferredTime && <div className="error" style={{ marginTop: '8px' }}>{errors.preferredTime}</div>}
              </div>
            </div>
          </div>

          <div style={{ display: 'flex', gap: '16px', marginTop: '30px' }}>
            <button
              type="button"
              className="btn btn-secondary"
              onClick={() => navigate('/')}
            >
              Back to Home
            </button>
            <button
              type="submit"
              className="btn btn-primary"
              style={{ flex: '1' }}
            >
              Find Healthcare Providers
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default UserIntakeForm;
